css:
@-moz-document domain("youtube.com") {
/*Create BY: SEKZ318*/

/*Enjoy*/

/*fondo inicio*/
ytd-page-manager,ytd-mini-guide-renderer.style-scope.ytd-app,.style-scope.ytd-mini-guide-renderer{
    background: url(https://images7.alphacoders.com/105/thumb-1920-1055055.png) no-repeat fixed top!important;
}
/*scrolbar*/
body::-webkit-scrollbar {
    width: 1em;
    background:#272c33;
}
 
body::-webkit-scrollbar-track {
    background: rgba(71, 78, 97);
}
 
body::-webkit-scrollbar-thumb {
  background-color: #047dd9a1;
    border-radius:10px;
}
/*fondo reproducción*/
ytd-watch-flexy,.ytd-browse,.ytd-guide-section-renderer{
    background-color: transparent !important;
}
/*fondo de los contenedores*/
#dismissable.style-scope.ytd-rich-grid-video-renderer{
    background:#272c33c9;
    border-radius:15px;
}
/*barra izquierda*/
#contentContainer.app-drawer {
width: 249px !important;
}

/*puntos de notificación de los canales*/
#newness-dot.ytd-guide-entry-renderer{
    background-color:#e87218;
}

/*barra izquierda desplegada*/
#guide-inner-content.style-scope.ytd-app{
    background:#272c33;
    border-radius:20px;
}
div#header.ytd-app{
    background:#272c33c9;
}
/*scrollbar de la barra izquierda*/
.style-scope.ytd-app::-webkit-scrollbar-thumb{
    border-radius:4px
}
/*menú izquierdo sin desplegar*/
ytd-mini-guide-renderer.style-scope.ytd-app{
    border-radius:20px;
}
/*fondo de donde estan los iconos*/
.style-scope.ytd-mini-guide-renderer{
    background:transparent;
}
/*cabecera de búsqueda*/
.style-scope.ytd-masthead{
    background:#272c33c9;
    border-radius:20px;
}
/*borde de la caja del icono de búsqueda*/
#search-icon-legacy.ytd-searchbox{
    background:#272c33c9 !important;
    border-radius:0px 10px 10px 0px;
}
/*icono de búsqueda*/
#search-icon-legacy.ytd-searchbox yt-icon.ytd-searchbox {
    color: hsl(0, 0%, 0%) !important;
}
/*barra de búsqueda*/
 div#container {
    border-radius: 13px !important;
}
/*searchbox border-radius*/
  #container.ytd-searchbox {
    border-radius: 10px 0px 0px 10px !important;
}
/*icono de ver más tarde + añadir a lista, cuando los iconos están pequeños*/
ytd-thumbnail-overlay-toggle-button-renderer.style-scope.ytd-thumbnail,ytd-thumbnail-overlay-time-status-renderer{
    border-radius: 10px !important;
}
ytd-thumbnail.style-scope.ytd-compact-video-renderer{
    border-radius:20px !important;
}
/*borde-reproductor de video / sombra */
  #movie_player, .video-stream, .ytp-small-mode {
    border-radius: 13px !important;
    box-shadow: 0px 0px 20px 10px rgba(0,0,0,0.5);
}
/*Borde de las los videos de recomendaciones*/
.ytp-videowall-still.ytp-suggestion-set{
    border-radius:10px !important;
    margin:10px;
}

/*borde de reproducción*/
a#thumbnail{
    border-radius: 12px !important;
}
/*boton de suscripcion*/
paper-button.ytd-subscribe-button-renderer{
    border-radius:20px;
}
/*borde de los videos principales*/
ytd-thumbnail#thymbnail{
    border-radius:20px !important;
    background:blue;
}
/*para borrar la publicidad*/
#top-container.style-scope.ytd-video-masthead-ad-v3-renderer{
    display:none;
}
}

@-moz-document url-prefix("http://example.com") {

}
